import React, { useEffect, useMemo, useState } from 'react';
import {
  Layout,
  Button,
  Space,
  Form,
  Input,
  InputNumber,
  message,
  Tag,
  Card,
  Typography,
  Modal,
  Row,
  Col,
  Tooltip,
  Empty,
  Tabs,
} from 'antd';
import {
  PlusOutlined,
  ArrowRightOutlined,
  EditOutlined,
  DeleteOutlined,
  RobotOutlined,
} from '@ant-design/icons';
import axios from 'axios';

const { Header, Content } = Layout;
const { Text, Title, Paragraph } = Typography;

interface ModelItem {
  model_id: string;
  name: string;
  endpoint: string;
  api_key: string;
  timeout?: number;
  type?: string;
  dimensions?: number;
}

interface ModelListResponse {
  list: ModelItem[];
  total: number;
  page: number;
  page_size: number;
}

const IndexPage: React.FC = () => {
  const [loading, setLoading] = useState(false);
  const [models, setModels] = useState<ModelItem[]>([]);
  const [activeModel, setActiveModel] = useState<ModelItem | null>(null);
  const [chatVisible, setChatVisible] = useState(false);
  const [chatLoading, setChatLoading] = useState(false);
  const [chatAnswer, setChatAnswer] = useState('');
  const [chatStreaming, setChatStreaming] = useState(false);
  const [editingModel, setEditingModel] = useState<ModelItem | null>(null);
  const [formVisible, setFormVisible] = useState(false);
  const [form] = Form.useForm();
  const [chatForm] = Form.useForm();

  const fetchModels = async () => {
    setLoading(true);
    try {
      const res = await axios.get('/api/v1/models/get', {
        params: { page: 1, page_size: 100 },
      });
      const data = res.data?.data as ModelListResponse;
      const list = data.list || [];
      setModels(list);
      if (!activeModel && list.length > 0) {
        setActiveModel(list[0]);
      }
    } catch (e: any) {
      message.error(e?.response?.data?.msg || '');
    } finally {
      setLoading(false);
    }
  };

  useEffect(() => {
    fetchModels();
  }, []);

  const stats = useMemo(() => {
    const total = models.length;
    const ready = models.filter((m) => m.endpoint && m.api_key).length;
    return { total, ready };
  }, [models]);

  const openCreate = () => {
    setEditingModel(null);
    form.resetFields();
    setFormVisible(true);
  };

  const openEdit = (m: ModelItem) => {
    setEditingModel(m);
    form.setFieldsValue({
      name: m.name,
      endpoint: m.endpoint,
      api_key: m.api_key,
      timeout: m.timeout,
      type: m.type,
      dimensions: m.dimensions,
    });
    setFormVisible(true);
  };

  const handleSaveModel = async () => {
    try {
      const values = await form.validateFields();
      if (editingModel) {
        await axios.put(`/api/v1/models/${editingModel.model_id}`, values);
        message.success('');
      } else {
        await axios.post('/api/v1/models/create', values);
        message.success('');
      }
      setFormVisible(false);
      await fetchModels();
    } catch {
      // ignore
    }
  };

  const handleDelete = (m: ModelItem) => {
    Modal.confirm({
      title: '',
      content: `${m.name}`,
      okButtonProps: { danger: true },
      onOk: async () => {
        try {
          await axios.delete(`/api/v1/models/${m.model_id}`);
          message.success('');
          if (activeModel?.model_id === m.model_id) {
            setActiveModel(null);
            setChatAnswer('');
            chatForm.resetFields();
          }
          await fetchModels();
        } catch (e: any) {
          message.error(e?.response?.data?.msg || '');
        }
      },
    });
  };

  const openChatWithModel = (m: ModelItem) => {
    setActiveModel(m);
    setChatVisible(true);
    setChatAnswer('');
    chatForm.resetFields();
  };

  const handleChat = async () => {
    if (!activeModel) {
      message.warning('');
      return;
    }
    try {
      const values = await chatForm.validateFields();
      setChatLoading(true);
      setChatStreaming(true);
      setChatAnswer('');

      const resp = await fetch(
        `/api/v1/models/chat/${activeModel.model_id}?stream=1`,
        {
          method: 'POST',
          headers: {
            'Content-Type': 'application/json',
          },
          body: JSON.stringify({ prompt: values.prompt }),
        },
      );

      if (!resp.ok) {
        const text = await resp.text();
        throw new Error(text || '');
      }

      const reader = resp.body?.getReader();
      if (!reader) {
        const text = await resp.text();
        setChatAnswer(text);
        setChatStreaming(false);
        return;
      }

      const decoder = new TextDecoder('utf-8');
      // 
      // eslint-disable-next-line no-constant-condition
      while (true) {
        const { done, value } = await reader.read();
        if (done) break;
        const chunk = decoder.decode(value, { stream: true });
        setChatAnswer((prev) => prev + chunk);
      }
      setChatStreaming(false);
    } catch (e: any) {
      message.error(e?.message || '');
      setChatStreaming(false);
    } finally {
      setChatLoading(false);
    }
  };

  return (
    <Layout
      style={{
        minHeight: '100vh',
        background:
          'radial-gradient(circle at top left, #f5f5f7 0, #ffffff 45%, #f5f5f7 100%)',
      }}
    >
      <Header
        style={{
          height: 64,
          lineHeight: '64px',
          padding: '0 56px',
          background: 'transparent',
          display: 'flex',
          alignItems: 'center',
          justifyContent: 'space-between',
          backdropFilter: 'saturate(180%) blur(20px)',
          WebkitBackdropFilter: 'saturate(180%) blur(20px)',
        }}
      >
        <Space size={16}>
          <RobotOutlined style={{ fontSize: 22, color: '#111' }} />
          <Text style={{ fontSize: 18, fontWeight: 600 }}>Alex_yehui</Text>
        </Space>
        <Space size={24}>
          <Text style={{ color: '#6e6e73' }}></Text>
          <Button type="primary" shape="round" icon={<PlusOutlined />} onClick={openCreate}>

          </Button>
        </Space>
      </Header>

      <Content style={{ padding: '24px 56px 56px' }}>
        {/* Hero section */}
        <div
          style={{
            maxWidth: 1180,
            margin: '0 auto 40px',
            textAlign: 'center',
          }}
        >
          <Title
            level={1}
            style={{
              marginBottom: 16,
              fontSize: 44,
              letterSpacing: 0.4,
              fontWeight: 600,
              color: '#111',
            }}
          >
             Alex_yehui 
          </Title>
          <Title
            level={4}
            style={{
              marginBottom: 32,
              fontWeight: 400,
              color: '#6e6e73',
            }}
          >
             AI / 
          </Title>
          <Space size={16} style={{ justifyContent: 'center' }}>
            <Button
              type="primary"
              size="large"
              shape="round"
              icon={<ArrowRightOutlined />}
              onClick={() => window.open('https://hexo.ismyh.cn/', '_blank')}
            >

            </Button>
            <Button shape="round" onClick={openCreate}>

            </Button>
            <Text style={{ color: '#6e6e73' }}>
               <strong>{stats.total}</strong> {' '}
              <strong>{stats.ready}</strong> 
            </Text>
          </Space>
        </div>

        {/* Main content with tabs ( / ) */}
        <div
          style={{
            maxWidth: 1180,
            margin: '0 auto',
          }}
        >
          <Tabs
            defaultActiveKey="welcome"
            items={[
              {
                key: 'welcome',
                label: '',
                children: (
                  <Row gutter={24}>
                    <Col xs={24} md={12} style={{ marginBottom: 24 }}>
                      <Card
                        bordered={false}
                        style={{
                          borderRadius: 24,
                          background: 'rgba(255,255,255,0.9)',
                          boxShadow: '0 10px 30px rgba(0,0,0,0.06)',
                        }}
                      >
                        <Title level={4} style={{ marginBottom: 12 }}>

                        </Title>
                        <Paragraph style={{ color: '#6e6e73' }}>
                           Alex_yehui  AI

                        </Paragraph>
                      </Card>
                    </Col>
                    <Col xs={24} md={12} style={{ marginBottom: 24 }}>
                      <Card
                        bordered={false}
                        style={{
                          borderRadius: 24,
                          background: 'rgba(255,255,255,0.9)',
                          boxShadow: '0 10px 30px rgba(0,0,0,0.06)',
                        }}
                      >
                        <Title level={4} style={{ marginBottom: 12 }}>

                        </Title>
                        <Paragraph style={{ color: '#6e6e73' }}>
                           /  AI 
                        </Paragraph>
                      </Card>
                    </Col>
                    <Col xs={24} md={12} style={{ marginBottom: 24 }}>
                      <Card
                        bordered={false}
                        style={{
                          borderRadius: 24,
                          background: 'rgba(255,255,255,0.9)',
                          boxShadow: '0 10px 30px rgba(0,0,0,0.06)',
                        }}
                      >
                        <Title level={4} style={{ marginBottom: 12 }}>

                        </Title>
                        <Paragraph style={{ color: '#6e6e73' }}>
                          {' '}
                          <a href="https://hexo.ismyh.cn/" target="_blank" rel="noreferrer">
                            https://hexo.ismyh.cn/
                          </a>

                        </Paragraph>
                      </Card>
                    </Col>
                    <Col xs={24} md={12} style={{ marginBottom: 24 }}>
                      <Card
                        bordered={false}
                        style={{
                          borderRadius: 24,
                          background: 'rgba(255,255,255,0.9)',
                          boxShadow: '0 10px 30px rgba(0,0,0,0.06)',
                        }}
                      >
                        <Title level={4} style={{ marginBottom: 12 }}>

                        </Title>
                        <Paragraph style={{ color: '#6e6e73' }}>

                        </Paragraph>
                      </Card>
                    </Col>
                  </Row>
                ),
              },
              {
                key: 'models',
                label: '',
                children: (
                  <Row gutter={24} align="stretch">
                    <Col xs={24} style={{ marginBottom: 24 }}>
                      <Card
                        bordered={false}
                        bodyStyle={{ padding: 24 }}
                        style={{
                          borderRadius: 28,
                          background:
                            'linear-gradient(135deg, rgba(250,250,252,0.9), rgba(245,245,247,0.9))',
                          boxShadow: '0 18px 40px rgba(0,0,0,0.06)',
                        }}
                        title={
                          <Space direction="vertical" size={4}>
                            <Text style={{ fontSize: 18, fontWeight: 600, color: '#111' }}>

                            </Text>
                            <Text style={{ fontSize: 13, color: '#6e6e73' }}>

                            </Text>
                          </Space>
                        }
                        extra={
                          <Button type="link" onClick={fetchModels} style={{ paddingRight: 0 }}>

                          </Button>
                        }
                      >
                        {models.length === 0 ? (
                          <div style={{ padding: '40px 0' }}>
                            <Empty
                              image={Empty.PRESENTED_IMAGE_SIMPLE}
                              description={
                                <span style={{ color: '#6e6e73' }}>

                                </span>
                              }
                            />
                          </div>
                        ) : (
                          <Row gutter={[16, 16]}>
                            {models.map((m) => {
                              const isActive = activeModel?.model_id === m.model_id;
                              return (
                                <Col xs={24} md={12} key={m.model_id}>
                                  <Card
                                    hoverable
                                    onClick={() => setActiveModel(m)}
                                    bordered={false}
                                    style={{
                                      borderRadius: 22,
                                      background: isActive ? '#111' : 'rgba(255,255,255,0.9)',
                                      color: isActive ? '#f5f5f7' : '#111',
                                      boxShadow: isActive
                                        ? '0 18px 40px rgba(0,0,0,0.35)'
                                        : '0 10px 30px rgba(0,0,0,0.06)',
                                      transform: isActive ? 'translateY(-2px)' : 'translateY(0)',
                                      transition: 'all 0.25s ease',
                                    }}
                                    bodyStyle={{ padding: 18 }}
                                  >
                                    <Space
                                      align="start"
                                      style={{ width: '100%', justifyContent: 'space-between' }}
                                    >
                                      <Space align="start">
                                        <div
                                          style={{
                                            width: 28,
                                            height: 28,
                                            borderRadius: '50%',
                                            background: isActive
                                              ? 'linear-gradient(135deg, #0ff, #0af)'
                                              : '#f5f5f7',
                                            display: 'flex',
                                            alignItems: 'center',
                                            justifyContent: 'center',
                                          }}
                                        >
                                          <RobotOutlined
                                            style={{
                                              fontSize: 16,
                                              color: isActive ? '#000' : '#111',
                                            }}
                                          />
                                        </div>
                                        <div>
                                          <Text
                                            style={{
                                              fontWeight: 600,
                                              fontSize: 16,
                                              color: isActive ? '#f5f5f7' : '#111',
                                            }}
                                          >
                                            {m.name}
                                          </Text>
                                          <div style={{ marginTop: 6 }}>
                                            {m.type ? (
                                              <Tag
                                                color={isActive ? 'default' : 'blue'}
                                                style={{
                                                  borderRadius: 999,
                                                  border: 'none',
                                                  background: isActive ? '#2c2c2e' : undefined,
                                                  color: isActive ? '#f5f5f7' : undefined,
                                                }}
                                              >
                                                {m.type}
                                              </Tag>
                                            ) : (
                                              <Tag
                                                style={{
                                                  borderRadius: 999,
                                                  border: 'none',
                                                  background: isActive ? '#2c2c2e' : '#f5f5f7',
                                                }}
                                              >

                                              </Tag>
                                            )}
                                          </div>
                                        </div>
                                      </Space>
                                      <Space size={8}>
                                        <Tooltip title="">
                                          <Button
                                            size="small"
                                            type={isActive ? 'primary' : 'default'}
                                            shape="round"
                                            onClick={(e) => {
                                              e.stopPropagation();
                                              openChatWithModel(m);
                                            }}
                                          >

                                          </Button>
                                        </Tooltip>
                                        <Tooltip title="">
                                          <Button
                                            size="small"
                                            type={isActive ? 'default' : 'text'}
                                            icon={<EditOutlined />}
                                            onClick={(e) => {
                                              e.stopPropagation();
                                              openEdit(m);
                                            }}
                                          />
                                        </Tooltip>
                                        <Tooltip title="">
                                          <Button
                                            size="small"
                                            type="text"
                                            danger
                                            icon={<DeleteOutlined />}
                                            onClick={(e) => {
                                              e.stopPropagation();
                                              handleDelete(m);
                                            }}
                                          />
                                        </Tooltip>
                                      </Space>
                                    </Space>

                                    <Paragraph
                                      style={{
                                        marginTop: 12,
                                        marginBottom: 8,
                                        fontSize: 12,
                                        color: isActive ? '#d2d2d7' : '#6e6e73',
                                      }}
                                      ellipsis={{ rows: 2 }}
                                    >
                                      {m.endpoint}
                                    </Paragraph>
                                    <Space size={16} style={{ fontSize: 11 }}>
                                      <span style={{ color: isActive ? '#a1a1a6' : '#6e6e73' }}>
                                         {m.dimensions ?? '-'}
                                      </span>
                                      <span style={{ color: isActive ? '#a1a1a6' : '#6e6e73' }}>
                                         {m.timeout ?? '-'}s
                                      </span>
                                    </Space>
                                  </Card>
                                </Col>
                              );
                            })}
                          </Row>
                        )}
                      </Card>
                    </Col>
                  </Row>
                ),
              },
            ]}
          />
        </div>
      </Content>

      {/*  */}
      <Modal
        open={chatVisible}
        onCancel={() => setChatVisible(false)}
        footer={null}
        width="100%"
        style={{ top: 0, padding: 0, maxWidth: '100%' }}
        bodyStyle={{ padding: 0 }}
      >
        <div
          style={{
            minHeight: '100vh',
            background:
              'radial-gradient(circle at top left, #f5f5f7 0, #ffffff 45%, #f5f5f7 100%)',
            display: 'flex',
            justifyContent: 'center',
            padding: '40px 16px',
          }}
        >
          <div
            style={{
              width: '100%',
              maxWidth: 840,
              background: 'rgba(255,255,255,0.96)',
              borderRadius: 28,
              boxShadow: '0 24px 60px rgba(0,0,0,0.15)',
              padding: 24,
              display: 'flex',
              flexDirection: 'column',
              maxHeight: '80vh',
            }}
          >
            <div style={{ marginBottom: 16 }}>
              <Space direction="vertical" size={4}>
                <Text style={{ fontSize: 18, fontWeight: 600, color: '#111' }}>
                  LLM 
                </Text>
                <Text style={{ fontSize: 13, color: '#6e6e73' }}>

                </Text>
              </Space>
            </div>

            <div style={{ flex: 1, overflow: 'hidden', display: 'flex', flexDirection: 'column' }}>
              <div
                style={{
                  flex: 1,
                  borderRadius: 18,
                  background: '#f5f5f7',
                  border: '1px solid #e5e5ea',
                  padding: 16,
                  marginBottom: 16,
                  fontFamily:
                    'SF Mono, Menlo, Monaco, Consolas, "Courier New", monospace',
                  fontSize: 11,
                  overflow: 'auto',
                }}
              >
                {chatAnswer ? (
                  <pre
                    style={{
                      margin: 0,
                      whiteSpace: 'pre-wrap',
                      wordBreak: 'break-all',
                      color: '#1d1d1f',
                    }}
                  >
                    {chatAnswer}
                  </pre>
                ) : (
                  <Text style={{ color: '#6e6e73' }}>
                     JSON 
                  </Text>
                )}
                {chatStreaming && (
                  <div style={{ marginTop: 8 }}>
                    <Text style={{ fontSize: 11, color: '#a1a1a6' }}>

                    </Text>
                  </div>
                )}
              </div>

              <Form form={chatForm} layout="vertical">
                <Form.Item
                  label={<Text style={{ color: '#111', fontSize: 13 }}></Text>}
                  name="prompt"
                  rules={[{ required: true, message: '' }]}
                >
                  <Input.TextArea
                    rows={3}
                    placeholder=" Go "
                  />
                </Form.Item>
                <Space style={{ justifyContent: 'flex-end', width: '100%' }}>
                  <Button
                    onClick={() => {
                      chatForm.resetFields();
                      setChatAnswer('');
                    }}
                  >

                  </Button>
                  <Button type="primary" loading={chatLoading} onClick={handleChat}>

                  </Button>
                </Space>
              </Form>
            </div>
          </div>
        </div>
      </Modal>

      <Modal
        title={editingModel ? '' : ''}
        open={formVisible}
        onCancel={() => setFormVisible(false)}
        onOk={handleSaveModel}
        okText=""
        width={520}
      >
        <Form form={form} layout="vertical">
          <Form.Item
            label=""
            name="name"
            rules={[{ required: true, message: '' }]}
          >
            <Input placeholder="gpt-4o-2024" />
          </Form.Item>
          <Form.Item
            label="Endpoint"
            name="endpoint"
            rules={[{ required: true, message: ' Endpoint' }]}
          >
            <Input placeholder="https://api.openai.com/v1/chat/completions" />
          </Form.Item>
          <Form.Item
            label="API Key"
            name="api_key"
            rules={[{ required: true, message: ' API Key' }]}
          >
            <Input.Password placeholder="" />
          </Form.Item>
          <Form.Item label="" name="type">
            <Input placeholder="gpt-4o / glm-4 / qwen-max" />
          </Form.Item>
          <Form.Item label="" name="dimensions">
            <InputNumber style={{ width: '100%' }} placeholder=" 1536" />
          </Form.Item>
          <Form.Item label="()" name="timeout">
            <InputNumber style={{ width: '100%' }} placeholder=" 30" />
          </Form.Item>
        </Form>
      </Modal>
    </Layout>
  );
};

export default IndexPage;
